INSERT INTO `je_practice_goals` (`ID`, `user_id`, `goal`, `date`) VALUES
(2, 359, 'this is my goal!', '2022-06-15'),
(3, 2098, 'Be able to play 2 songs (at tempo) from a lead sheet. For song #2 the goal will be to create a shells arrangement using only a lead sheet.', '2022-06-15'),
(4, 3021, 'Become a more polished player by increasing my ability to improvise over standards.', '2022-06-15'),
(5, 2085, 'Add 2 new songs to my repertoire.', '2022-06-15'),
(6, 303, '1. 3 memorized (or w/notation or charts) songs in a repertoire in next 3-6 months 2. Improvisation on the repertoire progressions 3. Better Rhythm w/songs in repertoire & improvisation & sight singing the melodies as I go. *Note: Change out songs in repertoire from time to time but would like it to be covering 3 - 5 styles: Jazz, Bossa Nova, Funk or Blues & maybe an easy classical piece, incorporating some of the licks & concepts learned in TCI, PACE, etc. Brick by Brick by Brick', '2022-06-15'),
(7, 268, '(2022-06-16) Learn 2 standards by a lead sheet with shells in the left hand and melody in the right. Learn to play Happy Birthday in different styles for my grand daughter 17 anniversary on Oct. 2.  (2022-08-01) Lear a song from Carlos Jobim by nid year 2023.  Play live during a coaching in October.', '2022-06-16'),
(8, 3314, 'Get comfortable playing with both hands. Learn one song with shells.', '2022-06-16'),
(9, 1191, 'Take a lead sheet be able to play it with more of an authentic jazz sound with rhythm, dynamics and articulation.', '2022-06-16'),
(10, 958, 'Get better at analyzing and transposing songs. Learn how to transpose 2 songs.', '2022-06-16'),
(11, 2872, 'In the next 3 - 6 months I aim to be able to play and improvise basic jazz songs using chords and not by learning the music.', '2022-06-16'),
(12, 350, 'My goal is to bring the 3 following songs into my repertoire: 1) My Funny Valentine - arrangement #2 (70% ready), 2) My Foolish Heart (50-60% ready) and 3) Darn That Dream (50% ready).\r\n\r\n1st goal achieved!', '2022-06-16'),
(13, 3036, 'Proficient at all scales, major and minor, plus Harmonic and Blues for each scale Complete Home School Piano. Have some basic improvisation ability.', '2022-06-16'),
(14, 181, 'continue working on my improvisational skills and start writing music. Need a tutorial on garage band. Start working with musescore.', '2022-06-16'),
(15, 4144, 'The time difference makes it difficult for me to attend the live coaching. I hope this goal would merit your attention. I like jazz ballads or cocktail jazz but more on the slow or mellow side of things, like playing in the background while someone is simply relaxing. Of all the many things to learn, I need help to put an order in my practice.', '2022-06-17'),
(16, 289, '1) 12 bar blues in new key - TCI & NBP 2) 1 repertoire per month - All the thing you are Listen to Keith Jarred and Bill Evans 3) Play at the open mic or Jam session', '2022-06-17'),
(17, 2346, 'I want to get better at playing pop ballads from lead sheets and add two more songs to my repertoire (from lead-sheet, not fully arranged songs)', '2022-06-17'),
(18, 4500, '1. Better \\\'spacial awareness\\\' of the keyboard to allow me to play without looking at keys - ie at music. Currently having to learn a piece by heart as cannot read music and play at same time! 2. Improve reading of bass clef.', '2022-06-18'),
(19, 411, 'To play more fluidly, relaxed and in time: Blackbird In the Wee Small hours To be begin playing from a lead sheet, becoming better acquainted with shells To add My Romance to my Repertoire', '2022-06-18'),
(20, 1084, 'I want to add 2-3 new songs to repertoire, in the style of Elton John and/or Billy Joel and sound better than playing melody with root.\r\nWould also like to improv boogie woogie so that everyone around wants to get up and dance.', '2022-06-18'),
(21, 4352, 'I would like to improve my right/left hand independence, expand my knowledge and skill at playing scales in various keys, improve my reading (especially in the bass clef) and add a couple of songs to my repertoire', '2022-06-19'),
(22, 1177, 'I would like to be able to play 5 or 6 songs with good arrangements, memorized, and feel comfortable playing them for friends. I prefer ballads. Also, I need to be consistent about basic improvising blues and the songs I know. Trying to keep 6 songs under my fingers without music. Trying to get very comfortable with first 8 lessons of NB Blues Beginner.', '2022-06-20'),
(23, 1203, 'Learn 1 standard a month (3 in total) with rootless chords (group style) and melody in the RH.', '2022-06-20'),
(24, 3287, 'Learn how to play and improvise over a 12 bar blues. Learn the theory and know how to modulate to new keys.', '2022-06-20'),
(25, 4545, 'Being comfortable playing in any key, improving technique, start improvising and learning how to read music', '2022-06-21'),
(26, 800, '1. I want to learn to improvise with enclosures/chromatic steps 2. I want to develop my ability to arrange jazz songs (solo, accomaniment, intro, ending) 3. I want to learn two more songs (All The Things You Are, TBD Mercy, Mercy, Mercy)', '2022-06-22'),
(27, 2585, 'Get more fluid in my playing in all 12 keys, so I can become a better composer. It would help a lot if I can become quicker in inversions.', '2022-06-23'),
(28, 3859, 'Learn 3 keys C, Bb, and G and learn one new song (My Romance) in the next 30 days.', '2022-06-24'),
(29, 2495, 'Wish to add lessons that might contribute to Song Writing.\r\n\r\n.', '2022-06-26'),
(30, 3120, 'Improve 2 existing songs and add two new songs for emerging repertoire', '2022-06-27'),
(31, 3300, 'To get better at comping with bass and guitar player. Learn (2) jazz standards.', '2022-06-27'),
(32, 2961, 'By December 1, 2022 I would like to be able to play: 1. Major Scales of C, Eb, F, G, and Bb two octaves in contrary motion. 2. My Romance from A Lead Sheet. 3. Days of Wine & Roses from A Lead Sheet. Would like some assistance in finding where I can locate to download a Lead Sheet of Days of Wine & Roses. I would like to be a a proficiency and confidence level to create more ambitious goals for the following six months.', '2022-06-28'),
(33, 1529, 'Learn to improvise over Song For My Father. New York State of Mind.', '2022-06-28'),
(34, 3298, 'Get a short repertoire of songs Play all scales 2 octaves with both hands together Add some improv into my songs Start some blues lessons', '2022-06-28'),
(35, 512, 'Immediate goal is to keep adding on techniques from Bens Blues and NBGJP (beginner) lessons. Then move into advanced NBGJP next. Become more comfortable w soloing over the blues. \r\n\r\nGet basic Days of Wine & Roses and Autumn Leaves into repertoire category. Worry about soloing later concentrate on Blues ?', '2022-06-29'),
(36, 413, 'Going beyond written music. \r\nLearning 3 new songs for repertoir, creating the arrengements myself in order not to forget them so easily.\r\nStay accountable: Send in video for feedback every 2 weeks!', '2022-06-30'),
(37, 754, '1: Improve my sight reading ability.  This includes slowing down and playing with accuracy and then develop speed once my muscle memory is in place.\r\n2: Learn to be more relaxed at the piano and be more fluid in my playing.', '2022-07-01'),
(38, 3321, 'My goal is to have up to six Christmas songs ready to play as background music for a coming holiday party.', '2022-07-02'),
(39, 406, 'In the next six month I would like to have a few standards in repertoire that I can play at least with shells with simple comping rhythms/ and bassline with emphasis on keeping good time with left hand. Then after gaining proficiency would  like to do same with rootless chords in left hand.  Additionally I would like to be developing ability to do simple major scale and chord note improvising over diatonic progressions from the same standards, as well as developing ability to improvise over non-diatonic chords.', '2022-07-12'),
(40, 3514, 'July 13, 2022\r\n1. \\\'Moon River\\\' played twice, second time reharmonized?  Have song MEMORIZED and into repertoire by October 1st. \r\n\r\n2. \\\'The Look of Love\\\' played with accurate timing and swing to eventually play in Willie\\\'s trio setting by October 1st.\r\n\r\nAug 8, 2022\r\n1.  By OCTOBER 1st, be able to memorize and play \\\"Moon River\\\", with a couple of reharmonized chords, and modulate into \\\"My Romance\\\".\r\n2.  Put \\\"The Look of Love\\\" on back burner until January 2023.\r\n3.  Work on \\\"Shepard\\\'s Blues\\\" so I can play along with bass player.  Begin working on The Confident Improviser immediately.  Begin Christmas songs on OCTOBER 1st.', '2022-07-13'),
(41, 4406, 'Right now, my goal is to get better hand independence and learning all twelve scales - 2 octaves, left, right, together and contrary motion.', '2022-07-16'),
(42, 2135, 'In addition to milestones I plan to learn at least 2 songs to add to my repertoire\r\nInstead of \\\"quick wins\\\" like of adding songs I\\\'ve learned before I\\\'ll focus on songs I want to play long term.', '2022-07-18'),
(43, 2581, 'I want to learn 2 new songs and work on improvisation and reliability.', '2022-08-13');
