(203, 2, 2005, 400254, '', '2022-10-01 00:00:00', 'pass', '0000-00-00', 'Great job! Hand positioning looks really good too!'),
(204, 1, 2154, 0, 'premier-transfer', '2022-10-02 00:00:00', 'pass', '0000-00-00', 'Transfer to new Jazzedge Academy site'),
(205, 10, 2164, 547165, '', '2022-10-04 00:00:00', 'pass', '0000-00-00', 'Very nice. The RH should be more legato though, LH can play staccato but try playing the RH more legato moving forward.'),
(207, 4, 2370, 408830, '', '2022-10-04 00:00:00', 'pass', '0000-00-00', 'Great job Sam. Now. moving forward try to play them in eighth notes against the metronome. You are doing quarters.'),
(208, 1, 2437, 523561, '', '2022-10-04 00:00:00', 'pass', '0000-00-00', 'Be careful on D flat and F# in the RH. On both of those you messed up the last note. So D flat, end on 2, on F# be sure to cross under and end on 2'),
(209, 5, 2370, 408830, '', '2022-10-04 00:00:00', 'pass', '0000-00-00', 'Great work! Two suggestions: (1) practice the couple or three keys where you stumbled (such as Eb) to ensure that you really have those keys mastered. Second, don\\\'t forget to include the left hand, too.'),
(210, 6, 2370, 408830, '', '2022-10-05 00:00:00', 'pass', '0000-00-00', 'Nice job, can you also play them with the LH'),
(211, 5, 2148, 422912, '', '2022-10-06 00:00:00', 'pass', '0000-00-00', 'Excellent job - great adherence to the tempo, posture, and hand position.'),
(212, 11, 2125, 270892, '', '2022-10-07 00:00:00', 'pass', '0000-00-00', 'Great work. Love the use of the swing groove instead of the metronome. Nice work!'),
(213, 7, 2370, 408830, '', '2022-10-07 00:00:00', 'pass', '0000-00-00', 'Very good - focus on keys like D-flat and A-flat which noticeably gave you pause. Also, be sure to play with left hand and hands together (not RH only)'),
(214, 4, 2160, 531503, '', '2022-10-07 00:00:00', 'redo', '0000-00-00', 'Overall very good. You show an understanding of each key. But too many restarts, incorrect fingerings, and moving off the beat. Focus on the specific keys that need attention (ie, Gb, Eb, Ab, etc) and work to play correctly in no more than 3 attempts.'),
(215, 2, 2437, 523561, '', '2022-10-08 00:00:00', 'pass', '0000-00-00', 'Great! Watch the starting fingering on the Ab scale and B scale in the LH. Also, try to make sure the fingers stay curled and play with the fingerTIPS, not pads. This is most noticeable when you play the black notes.'),
(216, 1, 2569, 532101, '', '2022-10-09 00:00:00', 'pass', '0000-00-00', 'Great job! Excellent hand position and ability to stay on the beat. Next begin putting hands together.'),
(218, 5, 2123, 269798, '', '2022-10-11 00:00:00', 'pass', '0000-00-00', 'Great work! Great hand position and very clean, precise playing. I\\\'d like to hear you play this with a metronome to ensure you can stay on a steady beat. Make sure to include the metronome or drum groove on future submissions.'),
(219, 1, 2004, 553632, '', '2022-10-11 00:00:00', 'pass', '0000-00-00', 'Great job! Hand positioning looks really good too!'),
(220, 8, 2370, 408830, '', '2022-10-12 00:00:00', 'pass', '0000-00-00', 'Very good. Solid adherence to the tempo, ability to play correctly on the 1st (or 2nd) try. Suggest working in chromatic or random order, also.'),
(221, 9, 2370, 408830, '', '2022-10-12 00:00:00', 'pass', '0000-00-00', 'Great work. Try working chromatically and giving yourself 4 beats between chords to think about the next chord before playing.'),
(222, 10, 2370, 408830, '', '2022-10-12 00:00:00', 'pass', '0000-00-00', 'Great job. Suggestion - now that you\\\'ve done major, minor, and dominant, try playing each for a given key - or as part of a ii - V - I progression.'),
(223, 1, 2180, 433529, '', '2022-10-14 00:00:00', 'pass', '0000-00-00', 'Fix Gb (mistake in notes and fingering in LH). Also mistake in notes on G scale in RH. Excellent hand position. Great ability to stay on the beat. Camera angle does not show RH fingering.'),
(224, 1, 2352, 540355, '', '2022-10-16 00:00:00', 'pass', '0000-00-00', 'Very good. Suggest using a metronome so that you can demonstrate ability to play on a steady beat and be able to think through the notes, fingerings, etc with a groove.'),
(225, 2, 2352, 540355, '', '2022-10-16 00:00:00', 'pass', '0000-00-00', 'Nice job Barbara! You\\\'ll keep getting better at these so just keep going. Sounds really good.'),
(226, 2, 2352, 540355, '', '2022-10-16 00:00:00', 'pass', '0000-00-00', 'Good work. Play with a metronome at 100 bpm to demonstrate ability to stay on a steady beat and to improve your overall sense of time. Some of the things you\\\'re playing now will prove more difficult with a metronome, evidence of whether you really know it or are giving yourself too many liberties with the steady beat.'),
(227, 1, 2424, 541349, '', '2022-10-18 00:00:00', 'pass', '2022-10-20', 'Great work! Nice job staying with the beat. Hand position looks great as well.'),
(228, 1, 2496, 542969, '', '2022-10-18 00:00:00', 'pass', '2022-10-20', 'Great work! video got pretty out of sync (sound and image not together). But your hand position looks very good, and all scales were played correctly. Suggest using a metronome to demonstrate ability to play on a steady beat for future submissions.'),
(229, 2, 2180, 433529, '', '2022-10-18 00:00:00', 'pass', '2022-10-20', 'Very good. Be sure to use a metronome - it\\\'s not just a steady beat-keeper, it also demonstrates your ability to recall and think through the scales quickly, demonstrating command of the material. A little hesitation in the Gb and F major area so double check those keys.'),
(244, 3, 2004, 553632, 'https://jazzpianolessons.com', '2022-10-16 11:58:44', 'redo', '2022-10-20', 'it\\\'s'),
(246, 3, 2004, 553632, 'https://jazzpianolessons.com', '2022-10-17 12:02:50', 'redo', '2022-10-20', 'sorry still redo!'),
(249, 3, 2004, 553632, 'take2', '2022-10-20 12:38:10', 'pass', '2022-10-20', 'Excellent job, continue working with the metronome and using the grab technique.'),
(250, 2, 2496, 542969, 'https://youtu.be/ZJRIu88MviA', '2022-10-20 01:20:19', 'pass', '2022-10-20', 'Excellent. Great pacing through each of the scales, moving quickly from one to the next. Good hand position and fingering. I suggest recording your performances with metronome.'),
(252, 3, 2352, 540355, 'https://www.youtube.com/watch?v=BnQbxAIe4qM', '2022-10-20 03:56:18', 'redo', '2022-10-27', 'Good job playing through the various keys. You are making a few mistakes with the notes. Most importantly, you are playing quarter notes at 70 bpm and the milestone calls for eighth notes at 100 bpm (which is significantly faster).'),
(253, 4, 2160, 531503, 'https://youtu.be/G9bUo8Yl51w', '2022-10-21 05:11:15', 'pass', '2022-10-27', 'Great job playing the scales correctly (notes and fingerings are highly accurate). But practice staying with the metronome more accurately - you are regularly off the beat within a couple beats of starting.'),
(254, 6, 2156, 516597, 'https://youtu.be/5Ujginb12rA', '2022-10-23 05:40:19', 'pass', '2022-10-27', 'Excellent! Try to use a metronome in all of your submissions to demonstrate rhythmic accuracy.'),
(255, 5, 2156, 516597, 'https://youtu.be/CN6142_oJJI', '2022-10-23 05:41:33', 'pass', '2022-10-27', 'Excellent! Again - use a metronome at 100bpm as indicated to demonstrate your ability to play to a steady beat.'),
