(269, 3, 2275, 324596, 'https://youtu.be/pTk076gK-9Y', '2022-11-01 02:13:26', 'pass', '2022-11-03', 'Excellent! Great mastery of the scales, excellent time-keeping with the metronome, great video (clearly shows posture, hand position, view of keyboard). Keep it up!'),
