(272, 3, 2607, 553337, 'https://youtu.be/mpZpfvtnlFc', '2022-11-06 03:39:47', 'pass', '2022-11-10', 'Excellent! Great job staying in time with the metronome, very nice hand position (curled fingers and relaxed shoulders), and solid job playing the scales (very few mistakes, strong ability to move from one key to the next quickly and accurately).'),
(273, 4, 2275, 324596, 'https://youtu.be/6pF9xTazvcA', '2022-11-06 05:43:06', 'pass', '2022-11-10', 'Excellent! Great work staying in time with the metronome, great hand position (fingers curled, shoulders relaxed), and great job moving quickly and accurately from one key/scale to the next.'),
(274, 6, 2148, 422912, 'https://youtu.be/hQKrsnRhb9E', '2022-11-08 04:33:20', 'pass', '2022-11-10', 'Excellent! Nicely done. Hand position looks good (curled fingers, relaxed shoulders); strong ability to move quickly and accurately from one key to the next; great job staying in time with the metronome.'),
(275, 3, 2005, 400254, 'https://youtu.be/ISF40nahKho', '2022-11-14 11:59:15', 'pass', '2022-11-17', 'Hi Michle! Great job - scales sound excellent (and so does the new piano!) Hand/wrist position looks great, scales sound steady and even as you play through each one. My one suggestion (you already know what\\\'s coming) = use your metronome. haha'),
(276, 4, 2121, 525765, 'https://youtu.be/YzQ_pdSvs6M ', '2022-11-17 02:29:06', 'pass', '2022-11-29', 'Good work. Review some of the keys where you stumbled (i.e., A-flat, D-flat, E-flat, B, G-flat). Also suggest using a metronome.'),
(277, 4, 2162, 537443, 'https://youtu.be/STYmEFW0u3c', '2022-11-17 03:10:46', 'pass', '2022-11-29', 'Excellent work! Great job moving quickly and smoothly between keys/scales, staying on the beat, following the proper fingering!'),
(278, 12, 2125, 270892, 'https://youtu.be/lTi_5Pp0kFI', '2022-11-20 05:13:36', 'pass', '2022-11-29', 'Great work - solid ability to identify and move quickly and proficiently from one key to the next, good ability to transition from major to dominant to minor, great job staying with the metronome. (Review E-flat minor)'),
(279, 3, 2334, 407466, 'https://youtu.be/OGd0peMEeN0', '2022-11-20 05:50:12', 'pass', '2022-11-29', 'Well done! Good ability to move quickly through the various keys with accuracy, good hand position and fingering; suggest using metronome.'),
(280, 11, 2164, 547165, 'https://youtu.be/dN1j1hyGSNw', '2022-11-20 07:47:06', 'pass', '2022-11-29', 'Great work! Suggest using the metronome as you play to reinforce a sense of time (or perhaps metronome on beats 2 and 4 to provide a swing feel). Very good job moving quickly through the various keys with a high degree of accuracy.'),
(281, 4, 2150, 427216, 'https://youtu.be/jPqxe92FkR4', '2022-11-26 09:15:40', 'pass', '2022-11-29', 'Good work. A couple suggestions: (1) this might be easier if you had the various scales/keys memorized (appears as though you are reading quite a bit, which is not easy); (2) focus on the keys that gave you a bit of trouble (such as A-flat).'),
(282, 1, 2673, 303682, 'https://youtu.be/IC2dBUX3EyM', '2022-11-30 06:45:52', 'pass', '2022-12-09', 'Great job. Use a metronome if you can to practice working with a metronome. Also use a weighted action keyboard (or piano) if you have one to add more resistance.'),
(283, 7, 2148, 422912, 'https://youtu.be/3MVJYI3Amns', '2022-12-02 03:53:30', 'pass', '2022-12-12', 'Great work - nice use of the metronome, rhythmic variety, harmonic variety (arpeggios in harmony). Very musical approach to the exercise - great job!'),
(284, 7, 2156, 516597, 'https://youtu.be/skTiHQqTLs0', '2022-12-03 08:01:26', 'pass', '2022-12-12', 'Great job - nice use of the metronome, good demonstration of competence and ability to move through each new key quickly and accurately.'),
(285, 3, 2437, 523561, 'https://youtu.be/Zd4SSSF0NpI', '2022-12-03 02:23:25', 'pass', '2022-12-12', 'Very good! Excellent use of metronome, strong ability to quickly and competently/accurately move through each new key. One suggestion - try to round the fingers a bit more so that you are playing with the finger tips as opposed to the finger pads.'),
(286, 1, 2975, 556313, 'https://youtu.be/RbrqJ39dIzM', '2022-12-03 03:17:25', 'pass', '2022-12-12', 'Great work. Strong ability to move through each new key quickly, competently, and accurately. Suggest using a metronome (especially since you\\\'re already feeling the beat when tapping your foot).'),
(287, 2, 2975, 556313, 'https://youtu.be/V50z0CooGSg', '2022-12-03 03:18:54', 'pass', '2022-12-12', 'great job! Very good ability to move to each new key quickly and accurately. Suggest using a metronome or drum groove - your time sounds very solid so this would just be good efficient practice to play with a groove.'),
(288, 3, 2975, 556313, 'https://youtu.be/BnL8sN3HTmc', '2022-12-03 03:19:52', 'pass', '2022-12-13', 'Good job. Again, suggest using the metronome because you are already playing in time and tapping along. The metronome adds the ability to focus on rhythmic precision/accuracy. Great job moving quickly from scale to scale.'),
(289, 4, 2975, 556313, 'https://youtu.be/wTGe3aS7i78', '2022-12-03 03:20:33', 'pass', '2022-12-13', 'Very good - demonstrates strong command of hand independence, time-keeping, accuracy of each scale, ability to recall new scale/key signature quickly. A couple miscues - focus on smoothing those out and taking notice of which keys are more challenging.'),
(290, 5, 2975, 556313, 'https://youtu.be/6t9p7BoHMFc', '2022-12-03 03:21:26', 'pass', '2022-12-13', 'Great job! Moves through each key accurately, good attack (ie, playing the notes of each chord with the same weight distribution in the fingers so that all notes sound equally in volume). Able to play in time with just a few miscues.'),
(291, 6, 2975, 556313, 'https://youtu.be/JtNq6cb1ivM', '2022-12-03 03:22:01', 'pass', '2022-12-13', 'Great work! All chords played accurately, able to move from one key to the next quickly without mistakes. A couple miscues in the time-keeping - suggest working with a metronome and focusing on those keys that present small mistakes.'),
(292, 1, 3114, 556895, 'https://youtu.be/a87_zGZzOE0', '2022-12-07 01:43:38', 'pass', '2022-12-13', 'Great job! Very accurate in your ability to move from one key to the next quickly and accurately. Excellent job staying in time with the metronome - very precise rhythmically. Good attention to proper fingering.'),
(293, 4, 2153, 485919, 'https://youtu.be/HZyeKM7O9tk', '2022-12-07 02:25:15', 'pass', '2022-12-13', 'Very good. Good ability to move to each new key quickly and accurately. Review some of the keys that tripped you up (such as E-flat). Suggest using a metronome for some rhythmic support. Great attention to detail with the fingering.'),
(294, 4, 2153, 485919, 'https://youtu.be/HZyeKM7O9tk', '2022-12-07 02:25:19', 'pass', '2022-12-13', 'Very good. Good ability competently moving from one key/scale to the next. Suggest using a metronome to (1) keep everything at the same precise tempo and (2) reveal which keys are easy for you and which ones might need more attention. Good fingering, too!'),
(295, 2, 3114, 556895, 'https://youtu.be/MTfiXfs5ls4', '2022-12-07 06:49:40', 'pass', '2022-12-13', 'Great work. Excellent job keeping time with the metronome. Good ability to move from one key/scale to the next quickly and accurately. Good fingering - try to keep your wrists a little higher (sometimes looks like they\\\'re below the key rail).'),
(296, 4, 2607, 553337, 'https://www.youtube.com/watch?v=mA0U_JO1Djw', '2022-12-09 11:58:24', 'pass', '2022-12-13', 'Great work! Solid ability to move from one key/scale to the next quickly and accurately. Glad to see you using the metronome. Fingering and hand position looks very good.'),
(297, 6, 2123, 269798, 'https://youtu.be/LCOR5oFT7Oc', '2022-12-13 12:21:53', 'pass', '2022-12-13', 'Great job! Love the use of the backing track - excellent substitute for the metronome. Good job moving quickly and accurately to each new key/chord, keeping time with the beat, and hand position looks very good, too.'),
(299, 1, 3193, 557123, 'https://youtu.be/28wqcuenyU0', '2022-12-15 04:04:54', 'pass', '2022-12-16', 'Very good - excellent ability to stay with the metronome, move competently from one key to the next. Great hand position and fingering.'),
(300, 4, 2140, 403768, 'https://youtu.be/PLNdf3EdiU8', '2022-12-17 05:07:02', 'pass', '2022-12-27', 'Good work. Some of the keys give you pause, so try to practice those keys (like D major) specifically in order to make them steadier and smoother when playing. Suggest a metronome at a slow tempo, too.'),
(301, 1, 2657, 417322, 'https://youtube.com/watch?v=mS9H-K6pVfc&feature=shares', '2022-12-18 02:24:59', 'pass', '2022-12-27', 'Very good! Solid ability to move through the various keys quickly, demonstrating good recall and execution. Suggest using a metronome at a slow tempo to help you simultaneously work on rhythmic accuracy.'),
(303, 3, 3114, 556895, 'https://youtu.be/BPjhAPYfpbI', '2022-12-20 08:17:58', 'pass', '2022-12-27', 'Excellent posture and hand position. Great precision/time-keeping with the metronome. Solid recall ability, moving quickly through the various keys.'),
(304, 4, 2129, 290636, 'https://youtu.be/ca1LW9zd7IU', '2022-12-21 01:35:52', 'pass', '2022-12-27', 'Great job. Excellent posture and hand position. Very good ability to recall the various notes/fingerings of each scale and play them smoothly and steadily. Suggest also using a metronome to reinforce rhythmic precision.'),
(305, 4, 2352, 540355, 'https://www.youtube.com/watch?v=FPa2jUomWNg', '2022-12-21 03:23:48', 'pass', '2022-12-27', 'Good hand position. Solid ability to recall the various notes/fingerings of each scale and play them smoothly and steadily. Review the ones that gave you pause (such as B major). Suggest also using a metronome to reinforce rhythmic precision.'),
(306, 3, 2424, 541349, 'https://youtu.be/5nGoTtVkkyA', '2022-12-22 02:14:46', 'pass', '2022-12-27', 'Great job. Good hand position. Very good ability to recall the various notes/fingerings of each scale and play them smoothly and steadily. Very good use ability to play with the metronome, demonstrating rhythmic precision.'),
(307, 3, 3077, 406192, 'https://youtu.be/HHBTGq1oDVo', '2022-12-22 03:55:21', 'pass', '2022-12-27', 'Great job. Very good ability to recall the various notes/fingerings of each scale and play them smoothly and steadily. Suggest also using a metronome to reinforce rhythmic precision.'),
(308, 2, 2673, 303682, 'https://youtu.be/Ebua2pz_QjE', '2022-12-23 02:23:05', 'pass', '2022-12-27', 'Very good ability to recall the various notes/fingerings of each scale and play them smoothly and steadily. Great use of the metronome, demonstrating rhythmic precision throughout.'),
(309, 2, 3193, 557123, 'https://youtu.be/LLemmVS8v7Q', '2022-12-27 01:19:15', 'pass', '2022-12-27', 'Great job. Excellent posture and hand position. Very good ability to recall the various notes/fingerings of each scale and play them smoothly and steadily. Excellent use of the metronome to reinforce/demonstrate rhythmic precision.'),
(310, 8, 2148, 422912, 'https://youtu.be/scpycZD69-s', '2022-12-30 04:48:07', 'pass', '2023-01-10', 'Nice! I like the comping pattern as well. One thing to try is to use some more grabbing on the chords to see how it feels. what you did is great but try grabbing even more to feel those notes under your fingers.'),
(311, 5, 2160, 531503, 'https://youtu.be/j4mailVbIGQ', '2022-12-30 06:42:33', 'pass', '2023-01-13', 'Good job - suggest using a metronome (for this and all submissions). Choose a tempo that can be maintained throughout.'),
(312, 5, 2607, 553337, 'https://www.youtube.com/watch?v=AfUXiDU6bDo', '2022-12-31 05:19:56', 'pass', '2023-01-13', 'Excellent. Very precise, strong ability to move from one key to the next, good use of metronome.'),
(313, 5, 2275, 324596, 'https://youtube.com/shorts/ORPOO2leTCM', '2023-01-01 07:02:12', 'pass', '2023-01-13', 'Excellent! Great use of metronome, exceptionally quick in your ability to move from one key to the next with precision.'),
(315, 12, 2164, 547165, 'https://youtu.be/pALgDspbdgc', '2023-01-01 08:43:38', 'pass', '2023-01-13', 'Very good. Good job using the metronome. Good job moving from one key to the next quickly and with a good degree of precision (couple occasional wrong notes, but no big deal). Yes, try to keep the pinkie finger curled as much as possible.'),
(316, 4, 3114, 556895, 'https://youtu.be/sO51PoHc-e8', '2023-01-03 03:04:59', 'pass', '2023-01-13', 'Great job - nice work staying in time with the metronome, excellent hand position and posture, great fingering, and strong ability to move quickly and competently from one key to the next.'),
(317, 8, 2123, 269798, 'https://youtube.com/shorts/07t-nxcKqBY', '2023-01-04 09:29:03', 'pass', '2023-01-13', 'Excellent job. Very good ability to move from one key to the next quickly and accurately. Hand position and fingering look great.'),
(318, 4, 2761, 257902, 'https://youtu.be/c1G-y2Tkt2s', '2023-01-05 07:46:20', 'pass', '2023-01-13', 'Excellent job quickly and accurately moving from one key to the next. Hand position and fingering are excellent. Very precise playing. Only critique would be that the metronome is clicking but you are always far ahead of the beat by the end of each scale.'),
(319, 4, 2376, 540683, 'https://www.youtube.com/watch?v=QPkgGuNZPBU&feature=youtu.be', '2023-01-10 07:12:10', 'pass', '2023-01-13', 'Great work - very precise playing, great job moving quickly and accurately from one key to the next. Excellent work staying on the beat with the metronome. Fingering and hand position also look very good.'),
(320, 7, 2123, 269798, 'https://youtu.be/Gq6W6UpyWcw', '2023-01-14 01:08:24', 'pass', '2023-01-20', 'Great job. Love the drum groove/metronome.'),
(321, 5, 3114, 556895, 'https://youtu.be/V6fkoQyjx0c', '2023-01-14 03:35:16', 'pass', '2023-01-20', 'Excellent work. Nice job staying with the metronome and moving competently through each key.'),
(322, 2, 2657, 417322, 'https://youtube.com/watch?v=mehjfp89yoI&feature=shares', '2023-01-16 08:46:20', 'pass', '2023-01-20', 'Great! Nice job moving quickly from one scale to the next. Next step would be to play along with a metronome just to further refine the rhythmic precision.'),
(323, 1, 2819, 398950, 'https://youtu.be/NVKjt8qEJsM', '2023-01-17 02:06:52', 'pass', '2023-01-20', 'Very good! Great job moving quickly and accurately from one key to the next. Suggest using a metronome as you continue to practice.'),
(325, 5, 2376, 540683, 'https://www.youtube.com/watch?v=6OOjqZ5n1n8', '2023-01-18 08:50:14', 'pass', '2023-01-20', 'Excellent - great job playing with the metronome and moving through each new key with accuracy.'),
(326, 2, 2266, 240628, 'https://youtu.be/dc90Ef-sezM', '2023-01-20 04:23:39', 'pass', '2023-01-20', 'Excellent! Great job playing with the metronome and moving to each new key with accuracy. Hand position/posture also looks good.'),
(327, 6, 2275, 324596, 'https://youtu.be/xAgl5t4fbwE', '2023-01-20 11:49:11', 'pass', '2023-01-20', 'Excellent! Great job moving quickly through each key/chord and staying in time with the metronome. Keep it up!'),
(328, 11, 2370, 408830, 'https://youtu.be/jY1Cr1UQnHc', '2023-01-20 08:22:25', 'pass', '2023-01-23', 'Remember that you can/should slow down the tempo if needed. Steady tempo is more important than speed when practicing. Memorization is also important with these chord progressions.'),
(329, 5, 2150, 427216, 'https://youtube.com/shorts/qcJVwR0LVQk?feature=share', '2023-01-20 10:33:05', 'pass', '2023-01-23', 'Great work! Nice job being able to move through each major triad quickly and competently. Suggest playing/practicing to a metronome.'),
(330, 1, 3480, 557807, 'https://youtu.be/D0_X2CrXhHw', '2023-01-21 12:03:06', 'pass', '2023-01-23', 'Very good. Excellent ability to move from one key to the next quickly and accurately. Suggest also practicing with a metronome.'),
(331, 1, 3220, 237094, 'https://youtu.be/3syv0-2XLz8', '2023-01-22 01:35:20', 'pass', '2023-01-23', 'Great work! Nice job moving from one scale to the next quickly and competently. Also great job staying in time with the metronome.'),
(332, 9, 2148, 422912, 'https://youtu.be/rVPUEB5T80A', '2023-01-23 04:11:40', 'pass', '2023-01-23', 'Excellent work - great job playing quickly and accurately from one key to the next, staying in time with the metronome, and moving around the circle of 5ths. Hand position and fingering also look great!'),
(333, 11, 2761, 257902, 'https://youtu.be/wiJaVSF5CXI', '2023-01-23 07:00:28', 'pass', '2023-02-11', 'Good work. Suggestion would be to practice with a metronome and/or a specific rhythm when comping (ie, to recreate how you might play those chords in a live music situation). Great job!'),
(334, 2, 2819, 398950, 'https://youtu.be/UkqCnp3RBdY', '2023-01-25 05:10:43', 'pass', '2023-02-11', 'Great work - nice job playing with the metronome! Good hand/finger position. Make sure your shoulders are relaxed (bench looks maybe a little bit too high). Solid ability moving from one scale to the next quickly and accurately.'),
(335, 6, 2607, 553337, 'https://www.youtube.com/watch?v=yMEqLTQ_0rc', '2023-01-28 03:18:29', 'pass', '2023-02-11', 'Excellent! I can see (but not hear) the metronome - no problem but continue to work with the metronome bc it helps reinforce the time/rhythmic accuracy. Great hand position - great job moving through all the chords and inversions quickly and accurately.'),
(336, 2, 2087, 290338, 'https://youtu.be/cisAsRq1tPQ', '2023-01-30 11:51:42', 'pass', '2023-02-11', 'Excellent! Great job staying in time with the metronome, hand/finger-position/posture look great. Nice job moving quickly and accurately from one scale to the next.'),
(337, 3, 2087, 290338, 'https://youtu.be/VVkx6Eq3-KA', '2023-01-30 12:03:16', 'pass', '2023-02-11', 'Excellent work! Great job staying in time with the metronome, moving through each skill decisively and accurately, keeping posture and mechanics (hand, wrist, fingers) in good form.'),
(338, 4, 2005, 400254, 'https://youtu.be/aPmnmIsb6CY', '2023-01-30 03:48:19', 'pass', '2023-02-11', 'Great job, Michele! Hand-position and fingers look good. All notes and rhythms highly accurate. Couple suggestions: metronome (or drum groove) and try to play all scales in one video for memorization, rather than individually.'),
(339, 6, 3114, 556895, 'https://youtu.be/2KxMJaYq72s', '2023-02-02 05:34:42', 'pass', '2023-02-11', 'Great job. Nice work staying with the metronome, moving quickly and competently through each triad/inversion. Posture and mechanics (hands, fingers, wrist) all look good.'),
(340, 1, 3192, 557121, 'https://youtu.be/r2nZQDlOug0', '2023-02-03 06:52:46', 'pass', '2023-02-11', 'Nice job! Very good ability to stay in time with the metronome. Hand position and fingering look good. Nice work moving through each scale quickly and accurately.'),
(341, 13, 2164, 547165, 'https://youtu.be/wInO2VlUCxk', '2023-02-04 06:36:40', 'pass', '2023-02-11', 'Nice job! Try to lay back on the beat (sometimes you\\\'re regularly ahead of the beat). Hand position/fingering looks good. Diminished, sus2, and sus4 all sound good - lots to remember there. Were augmented included?'),
(342, 13, 2125, 270892, 'https://youtu.be/TtFg-jI9ASs', '2023-02-05 08:14:28', 'pass', '2023-02-11', 'Nice job! Great work on all of those chords (dim., augmented, sus2, sus4). Good hand position and fingering. Great work staying in time with the metronome!'),
(347, 7, 2275, 324596, 'https://youtu.be/UfZTGA8Hubs', '2023-02-06 07:09:17', 'pass', '2023-02-11', 'Excellent! Hand position and fingering look great. Excellent work staying with the metronome. Everything sounds well-learned, moving from each key, chord, arpeggio quickly and accurately. Nice job!'),
(348, 8, 2275, 324596, 'https://youtube.com/shorts/xbbw-rrsRtA', '2023-02-06 07:10:02', 'pass', '2023-02-11', 'Excellent. Again, well-learned, good fingering, moving quickly through each chord/arpeggio chromatically.'),
(349, 9, 2275, 324596, 'https://youtube.com/shorts/shhw8FwBo5g', '2023-02-06 07:10:51', 'pass', '2023-02-11', 'Excellent! Again, hand position and fingering looks good, demonstrating command of the material by moving quickly and without error through each key/chord/arpeggio.'),
(350, 5, 2153, 485919, 'https://youtu.be/8GC0WZDRuos', '2023-02-07 11:08:36', 'pass', '2023-02-11', 'Very good! Nice job moving through each chord quickly and competently, demonstrating command of the material. Suggest using a metronome to reinforce a steady sense of time/groove. Hand position and fingering also look very good.'),
(351, 3, 3193, 557123, 'https://youtu.be/SOeIfHZDPfM', '2023-02-11 06:23:26', 'pass', '2023-02-11', 'Great work! Hand position and fingering look good. Moving quickly and accurately through each scale demonstrates command of the material - nice job. Excellent work staying in time with the metronome, too!'),
(352, 10, 2275, 324596, 'https://youtube.com/shorts/3OvFeqihkcE', '2023-02-12 02:38:20', 'pass', '2023-02-13', 'Great job! Fingers and hand position all look great. Arpeggios all played very well. Nice work.'),
(353, 2, 3192, 557121, 'https://youtu.be/tHgTCFPgnvw', '2023-02-13 06:11:44', 'pass', '2023-02-13', 'Very good. Nice job with the fingering and moving through the scales accurately and quickly. Suggest using a metronome (at any tempo) in order to reinforce a steady pulse.'),
(354, 1, 2763, 262214, 'https://youtu.be/EOsEJ5Oc9wE', '2023-02-14 03:41:06', 'pass', '2023-02-22', 'Excellent work! Great job quickly and accurately moving from one scale to the next without mistakes. Great job keeping time with the metronome.'),
(355, 2, 2763, 262214, 'https://youtu.be/QZWeanKXFME', '2023-02-14 03:42:59', 'pass', '2023-02-22', 'Great job! Nice job being able to move through each scale quickly and without mistake. Continue working with the metronome, sounds great! Fingering looks good too.'),
(356, 14, 2164, 547165, 'https://youtu.be/t-oOCXHNihA', '2023-02-14 09:25:23', 'pass', '2023-02-22', 'Very good! Reminder (just fyi): there are only 3 diminished 7th chords before everything else is just an inversion of one of those 3 diminished chords.'),
(357, 14, 2164, 547165, 'https://youtu.be/t-oOCXHNihA', '2023-02-14 09:28:22', 'pass', '2023-02-22', 'I think you submitted this twice.'),
(358, 5, 2121, 525765, 'https://youtu.be/JxRLQEieh2g', '2023-02-16 12:39:27', 'pass', '2023-02-22', 'Excellent! Great pacing, moving through each triad accurately and quickly. Good job playing with the metronome, too (occasionally a little ahead of the beat - rushing - but overall very good).'),
(359, 7, 2607, 553337, 'https://www.youtube.com/watch?v=KtOXI0BwYz4', '2023-02-17 05:14:01', 'pass', '2023-02-22', 'Excellent! Very clear, accurate, very rhythmically precise (with the metronome). Great job!'),
(360, 8, 2607, 553337, 'https://www.youtube.com/watch?v=3DrX0GRNnA0', '2023-02-17 10:11:42', 'pass', '2023-02-22', 'Great work moving quickly and accurately through each of the chords/arpeggios. Great job staying in time with the metronome, too.');
INSERT INTO `je_practice_milestone_submissions` (`ID`, `curriculum_id`, `user_id`, `infusion_id`, `video_url`, `submission_date`, `grade`, `graded_on`, `teacher_notes`) VALUES
(361, 7, 3114, 556895, 'https://youtu.be/06v68YKO6Is', '2023-02-17 12:55:09', 'pass', '2023-02-22', 'Great job! Very precise playing with the metronome, accurate movement through each series of chords/arpeggios. Excellent!'),
(362, 14, 2125, 270892, 'https://youtu.be/fgpYI5lrfNohttps://youtu.be/fgpYI5lrfNo', '2023-02-18 09:07:26', 'pass', '2023-02-22', 'Sounds great! Great camera angle. Nice work moving through each of the chords/arpeggios accurately. Fingering looks and sounds very good. One suggestion would be to always do this type of practice with a metronome.'),
