(537, 31, 2370, 408830, 'https://youtu.be/zeXalxUvieA?si=xNiYMmJ6NthZv1pv', '2024-09-10 14:47:00', 'pass', '2024-09-17', 'Nicely done. Work on Eb a bit more and be sure to grab at those notes vs push'),
