(540, 7, 2352, 540355, 'https://youtu.be/pTnrSSPDtrU?si=BKYWQyzFILVqk5qu', '2024-09-19 14:42:12', 'pass', '2024-09-20', 'Nicely done! See if moving forward you can speed these up a bit an consider using a metronome. Also try to look at your hands less. Great job!'),
