(545, 9, 7550, 565810, 'https://youtu.be/ykb-DPEEmi8', '2024-10-05 14:39:13', 'pass', '2024-10-22', 'Good job. Try to \\\"think ahead\\\" to the next chord so there is no break between chords'),
(546, 10, 7550, 565810, 'https://youtu.be/65IsPhhM1ak', '2024-10-05 18:16:16', 'pass', '2024-10-22', 'Excellent'),
(547, 33, 2370, 408830, 'https://youtu.be/AKTltJroCZs', '2024-10-07 14:36:31', 'pass', '2024-10-25', 'Right on! Try sitting about 2 inches further back to give yourself a bit more room, hinge at the waist to move in. ive that a try to see how it feels'),
(548, 34, 2370, 408830, 'https://www.youtube.com/watch?v=UYVobuX0iS8', '2024-10-14 15:00:54', 'pass', '2024-10-25', 'Excellent. You can also do the approach for the octave (top root) as well.'),
(550, 12, 2136, 325552, 'https://youtu.be/0LbzlLTOmfM', '2024-10-28 14:45:56', 'pass', '2024-10-29', 'Very nice job on this Jude! I know that this is not easy stuff. I would like you to keep moving on in JPC but continue to play these arpeggios and try to work them in here and there into your practice.'),
