(580, 33, 2121, 525765, 'https://youtu.be/I7U10ZdgUmI', '2025-04-12 16:47:39', 'pass', '2025-05-12', 'No audio on this one, but I could see that you were playing the notes right so I\\\'m going to pass this. No need to resubmit.'),
(581, 8, 2132, 304472, 'https://youtu.be/Kmk0I5fUoZs', '2025-04-20 18:07:01', 'pass', '2025-05-12', 'Strong as usual great job. If you wanna challenge, try changing the order of the arpeggio in order to outer stuff like that.'),
(582, 9, 2132, 304472, 'https://youtu.be/JPnUCmkqB3c', '2025-04-20 18:09:40', 'pass', '2025-05-12', 'Same as the major seventh great job you could change your order for a challenge'),
(583, 34, 2121, 525765, 'https://youtu.be/Zjf4Q4Gzvuo', '2025-04-23 12:40:33', 'pass', '2025-05-12', 'Need to check your audio on these. But from what I saw, it looked good. I\\\'m going to pass this. No need to resubmit.'),
(584, 35, 2121, 525765, 'https://youtu.be/3nLtD6MfW38', '2025-05-08 13:23:14', 'pass', '2025-05-12', 'Yeah! Comping is solid and steady - nice job!'),
(585, 18, 2148, 422912, 'https://youtu.be/cCL1QWBEbYE', '2025-06-04 15:22:55', 'pass', '2025-07-18', 'Solid work on this Olaf, nicely done. Suggestion, start the metronome then click eighth notes with your tongue or tap or think of them in your head before starting to make sure you are with the metronome right at the beginning. Good work!'),
(586, 12, 2819, 398950, 'https://youtu.be/hurxq9NE4B8', '2025-07-19 13:33:22', 'pass', '2025-09-18', 'Sorry for the delay getting back to you Bob. Nice job on this. My only suggestion is try grabbing at the chords more and raise the wrist a little bit so it\\\'s a little bit higher than parallel. Join me on a coaching session I can show you exactly what I me'),
(591, 2, 3898, 558711, 'https://youtu.be/2XOJEyDJVG4', '2025-07-27 12:21:34', 'pass', '2025-09-18', 'Yes, Tom this is exactly what I\\\'m looking for. Body is loose. Arms are moving nice and steady and everything is working well with the metronome so great job on this. I couldn\\\'t see video number one so you can resubmit that if you want. Sorry for the delay'),
(592, 36, 2121, 525765, 'https://youtu.be/vBWNzhpyrwg', '2025-08-06 17:06:41', 'pass', '2025-09-18', 'Hey Mark, I like what you did here and I especially like that even though you\\\'re making some mistakes you\\\'re recognizing those mistakes and looking for ways to improve them so great job on that. Remember that a lot of of this material especially at this s'),
(593, 19, 2148, 422912, 'https://youtu.be/CHC_vtao9vY', '2025-08-12 15:55:00', 'pass', '2025-09-18', 'Hey Olaf, sorry about the delay in getting back to you with this milestone. You did a great job on this. I love how the body and arms are loose and you\\\'re playing light. No criticism at all just keep going.'),
(594, 37, 2121, 525765, 'https://youtu.be/fdKhCoYgL8o', '2025-08-24 18:41:24', 'pass', '2025-09-18', 'Again, nice job Mark. I love how you\\\'re just sticking with this and kind of laughing at yourself a bit when making a mistake and saying geez and what not. It\\\'s a great approach and a great mindset. As I said before, a lot of this stuff will gel later.'),
(595, 3, 3898, 558711, 'https://youtu.be/hJ2Fko8Y-K4', '2025-08-31 14:50:18', 'pass', '2025-09-18', 'Another great submission, nice and loose and steady sure couple of mistakes in there but you\\\'ve got the main point across and you\\\'re putting out some really good technique here so keep it going'),
(596, 3, 3898, 558711, 'https://youtu.be/hJ2Fko8Y-K4', '2025-08-31 14:50:31', 'pass', '2025-09-18', 'Nice job on this video as well Tom, loose, couple of mistakes but that\\\'s OK, so keep this going'),
(597, 38, 2121, 525765, 'https://youtu.be/y7hUOmOmebU', '2025-09-19 16:29:11', 'pass', '2025-09-23', 'Yeah man nice work. I know it is tough and at this point you want to start to think of which of these exercises you want to practice regularly to maintain. You wont keep all of them.'),
(600, 1, 3898, 558711, 'https://youtu.be/kPh6FPZPyiU', '2025-09-22 06:40:12', 'pass', '2025-09-23', 'Great work Tom, love the blindfold. You look loose and it is flowing nicely. Keep it up!'),
